type Color = "red" | "blue" | "green";

let color: Color = "red";

switch (color) {
    case "red":
        console.log("red");
        break;
    case "blue":
        console.log("blue");
        break;
    case "green":
        console.log("green");
        break;
}

enum Direction {
    Up,
    Down,
    Left,
    Right,
}
let dir: Direction = Direction.Up;

switch (dir) {
    case Direction.Up:
        console.log("up");
        break;
    case Direction.Down:
        console.log("down");
        break;
    case Direction.Left:
        console.log("left");
        break;

}
